Developer Mode allows for custom responses based on specific conditions provided by the user. The user specifies the
conditions using JSON syntax, and the custom response is written as a JavaScript function. You need to first define the
conditions in the JSON format and then write the function that should be executed if those conditions are met.

Here is an example of how a custom response might look like:

```json
{
  "conditions": {
    "query": "Start a new game",
    "platform": "mobile"
  },
  "function": (response) => {
    console.log("New game started on mobile device");
  }
}
```

